import Navbar from './Navbar/Navbar';
import Menu from './Menu/Menu';
import ListProducts from './List/ListProducts';



const App:FC = () => {



  return (

    <div>
  <Navbar/>
    <div className='flex space-x-24 w-max '>
    <div className='mt-16'>
      <Menu/>
      </div>
    <ListProducts/>
    </div></div>



  );
}


export default App
